package com.logicaldoc.gui.common.client.beans;

import java.io.Serializable;

/**
 * Branding ninformations
 * 
 * @author Marco Meschieri - LogicalDOC
 * @since 7.6.2
 */
public class GUIBranding implements Serializable {

	private static final long serialVersionUID = 1L;

	public static final String DATA_PREFIX = "data:image/";

	public static final String PNG_PREFIX = DATA_PREFIX + "png;base64,";

	private static final String SVG_PREFIX = DATA_PREFIX + "svg+xml;base64,";

	private static final String LOGO_OEM = PNG_PREFIX
			+ "";

	private String logo = SVG_PREFIX
			+ "";

	private String logoMenu = logo;

	private String logoHead = SVG_PREFIX
			+ "";

	private String favicon = SVG_PREFIX
			+ "";

	private String banner = PNG_PREFIX
			+ "";

	private String logoOem = LOGO_OEM;

	private String logoHeadOem = LOGO_OEM;

	private String productName = "LogicalDOC Community (free)";

	private String product = "LogicalDOC";

	private String help = "https://docs.logicaldoc.com";

	private String bugs = "https://bugs.logicaldoc.com";

	private String url = "https://www.logicaldoc.com";

	private String forum = "https://github.com/logicaldoc/community/discussions";

	private String evaluation = "";

	private String vendor = "LogicalDOC";

	private String vendorAddress = "via Aldo Moro interna, 3";

	private String vendorCap = "41012";

	private String vendorCountry = "Italy";

	private String vendorCity = "Carpi";

	private String support = "support@logicaldoc.com";

	private String sales = "sales@logicaldoc.com";

	private String skin = "Tahoe";

	private String css = null;

	private String head = null;

	private String top = null;

	private String bottom = null;

	private String footer = null;

	public String getProduct() {
		return product;
	}

	public void setProduct(String product) {
		this.product = product;
	}

	public String getProductName() {
		return productName;
	}

	public void setProductName(String productName) {
		this.productName = productName;
	}

	public String getHelp() {
		return help;
	}

	public void setHelp(String help) {
		this.help = help;
	}

	public String getBugs() {
		return bugs;
	}

	public void setBugs(String bugs) {
		this.bugs = bugs;
	}

	public String getVendor() {
		return vendor;
	}

	public void setVendor(String vendor) {
		this.vendor = vendor;
	}

	public String getUrl() {
		return url;
	}

	public void setUrl(String url) {
		this.url = url;
	}

	public String getVendorAddress() {
		return vendorAddress;
	}

	public void setVendorAddress(String vendorAddress) {
		this.vendorAddress = vendorAddress;
	}

	public String getVendorCap() {
		return vendorCap;
	}

	public void setVendorCap(String vendorCap) {
		this.vendorCap = vendorCap;
	}

	public String getVendorCountry() {
		return vendorCountry;
	}

	public void setVendorCountry(String vendorCountry) {
		this.vendorCountry = vendorCountry;
	}

	public String getVendorCity() {
		return vendorCity;
	}

	public void setVendorCity(String vendorCity) {
		this.vendorCity = vendorCity;
	}

	public String getSupport() {
		return support;
	}

	public void setSupport(String support) {
		this.support = support;
	}

	public String getForum() {
		return forum;
	}

	public void setForum(String forum) {
		this.forum = forum;
	}

	public String getLogo() {
		return logo;
	}

	public String getLogoMenu() {
		return logoMenu;
	}

	public void setLogoMenu(String logoMenu) {
		if (logoMenu != null && !logoMenu.startsWith(DATA_PREFIX))
			logoMenu = PNG_PREFIX + logoMenu;
		this.logoMenu = logoMenu;
	}

	public void setLogo(String logo) {
		if (logo != null && !logo.startsWith(DATA_PREFIX))
			logo = PNG_PREFIX + logo;
		this.logo = logo;
	}

	public String getLogoHead() {
		return logoHead;
	}

	public void setLogoHead(String logoHead) {
		if (logoHead != null && !logoHead.startsWith(DATA_PREFIX))
			logoHead = PNG_PREFIX + logoHead;
		this.logoHead = logoHead;
	}

	public void setLogoOem(String logoOem) {
		if (logoOem != null && !logoOem.startsWith(DATA_PREFIX))
			logoOem = PNG_PREFIX + logoOem;
		this.logoOem = logoOem;
	}

	public String getLogoOem() {
		return logoOem;
	}

	public boolean isLogoOemCustomized() {
		return !LOGO_OEM.equals(getLogoOem());
	}

	public String getLogoHeadOem() {
		return logoHeadOem;
	}

	public void setLogoHeadOem(String logoHeadOem) {
		if (logoHeadOem != null && !logoHeadOem.startsWith(DATA_PREFIX))
			logoHeadOem = PNG_PREFIX + logoHeadOem;
		this.logoHeadOem = logoHeadOem;
	}

	public String getBanner() {
		return banner;
	}

	public void setBanner(String banner) {
		if (banner != null && !banner.startsWith(DATA_PREFIX))
			banner = PNG_PREFIX + banner;
		this.banner = banner;
	}

	public String getFavicon() {
		return favicon;
	}

	public void setFavicon(String favicon) {
		if (favicon != null && !favicon.startsWith(DATA_PREFIX))
			favicon = PNG_PREFIX + favicon;
		this.favicon = favicon;
	}

	public String getSales() {
		return sales;
	}

	public void setSales(String sales) {
		this.sales = sales;
	}

	public String getSkin() {
		return skin;
	}

	public void setSkin(String skin) {
		this.skin = skin;
	}

	public String getCss() {
		return css;
	}

	public void setCss(String css) {
		this.css = css;
	}

	public String getHead() {
		return head;
	}

	public void setHead(String head) {
		this.head = head;
	}

	public String getTop() {
		return top;
	}

	public void setTop(String top) {
		this.top = top;
	}

	public String getBottom() {
		return bottom;
	}

	public void setBottom(String bottom) {
		this.bottom = bottom;
	}

	public String getFooter() {
		return footer;
	}

	public void setFooter(String footer) {
		this.footer = footer;
	}

	public String getEvaluation() {
		return evaluation;
	}

	public void setEvaluation(String evaluation) {
		this.evaluation = evaluation;
	}
}